import React from 'react';
import { Link } from 'react-router-dom';
import portugalFlagImage from '../images/illustration-portugal-flag_53876-18170.jpg.avif';
import '../styles.css';

function TopRestaurantsPage() {
  return (
    <div>
      <header>
        <img src={portugalFlagImage} alt="Portugal Flag" />
        <h1>Lisbon Restaurant Recommendations</h1>
        <nav>
          <Link to="/">Home</Link>
          <Link to="/top-restaurants">Top Restaurants</Link>
          <a href="cuisines.html">Cuisines</a>
          <a href="map.html">Map</a>
          <a href="price-ranges.html">Price Ranges</a>
        </nav>
      </header>
      <main>
        <div className="container2">
          <h2>Top Restaurants in Lisbon</h2>
          <ul id="restaurant-container"></ul>
        </div>
        <script src="script_top_restaurants.js"></script>
      </main>
    </div>
  );
}

export default TopRestaurantsPage;
